import React from "react";
import Logo from "../../../../components/Logo";

const Pricing = () => {
  return (
    <div className="scale-100 z-10" id="pricing">
      <h1 className="text-6xl max-sm:text-4xl font-medium z-10">
        Affordable Plans for Every Koder!
      </h1>
      <p className="text-gray-200 mt-3 z-10">
        Whether you're a beginner or a pro, we have the perfect plan to match
        your needs. Start koding smarter today!{" "}
      </p>
      <div className="bg-gray-700 w-full flex flex-col rounded-lg p-4 mt-4">
        <div className=" flex justify-around items-center">
             <Logo className="text-4xl" />
            <div className="bg-[#4F4F4F] h-[2em] w-[75%] rounded-full"></div>
        </div>
        <h2 className="mx-12 text-3xl mt-4">Plans & Pricing</h2>
        <p className="text-[#787878] mx-12">Simple Pricing. No Hidden Fees. Advanced Features for your Competitions</p>
        <div className="mx-10">
        <p className="text-[#787878] mx-12">Number of monthly compe</p>
        </div>
      </div>
    </div>
  );
};

export default Pricing;
